import React from 'react';
import "./srcNavbar.css";
import logo from "./comarca-logo-ok.png";

function navbar() {
    return (
        <nav className="navbar-container">
            <img className="logo-navbar" src= {logo} alt="logo de comarca de creadores" />
            <div className="navbar.itemsContainer">
                <ul>
                    <li className="navitem">Tienda</li>
                    <li className="navitem">Talleres</li>
                    <li className="navitem">Carrito</li>
                </ul>
            </div>
        </nav>
    );
};

export default navbar;
